Due to popular demand, I have added the black print version of Be Kind. This is a new run on the press therefore I cannot guarantee arrival by X-Mas. What I WILL guarantee is the finest, domestically made and hand printed hoodie you can find. 

They feature a hand printed to order, matte black print. On a gleaming White, 100% cotton California Fleece, Made In The USA American Apparel unisex pullover hoodie. 

Unlike typical synthetic fleece, California Fleece is made of 100% extra soft ring-spun combed cotton, pre-laundered for minimal shrinkage. Extra thick for extra warmth, yet breathable.

Hoodies CAN have a longer turnaround time than regular t-shirts. Please refer to the FAQ Page on the site. 

Unisex in sizes S THROUGH XXL. Ladies I would recommend ordering a size smaller than you normally do in a women's cut, depending on how you like your fit. Men, order your normal preferred size. Please see the pop-up size charts below.

